import React, { Component } from 'react';
import './Home.css';
import '../Font/Font.css';
import NutritionixAPI from '../Images/NutritionixAPI.png';
import Email from '../Images/Email.png';



class Footer extends Component {


  render() {




    return (
        <footer>
        <ul class= "social">

            <li class= "social social_icon"> <a href= "mailto:ultrayumm@gmail.com">
                <img class= "social contact_icon red" src= {Email} alt= "Email" title="Email your feedback"/>
            </a></li> 

            <li> <a href= "https://www.nutritionix.com" target= "_blank">
              <img class="attribution" src= {NutritionixAPI} alt="Nutritionix"/></a></li> 
      </ul>
    </footer>

    );
  }
}
export default Footer;
